    extern f64 sqrt_unsafe(f64 x){
        using namespace inc;

        // sqrt(x) = sqrt(x.xxx * 2^exp) = sqrt(x.xxx) * 2^(exp/2)
        mf64 m          = x;
        f64  r          = 1.0;
        ixx  exp        = m.real_exp_unsafe();
        ixx  new_e      = exp / 2;

        if (m.real_exp(new_e); new_e * 2 != exp){
            r           = sqrt_2;
        }

        // sqrt(x) = left:{sqrt(x / a0 / a1 ... / an)} * right:{sqrt(a0) * sqrt(a1) * ... * sqrt(an)}
        // 此算法通过查表让 left 趋近于 sqrt(1)
        for(uxx i = 0, shift = m.decimal_bits() - step; i < sizeof(lut) / sizeof(lut[0]); i++, shift -= step){
            auto idx    = m.decimal >> shift;
            auto pair   = lut[i][idx];
            auto mdiv   = pair[0]; // 倒数乘法代替除法
            auto mul    = pair[1];
            m          *= mdiv;
            r          *= mul;
        }

        // sqrt(x) -> 0.5 * x when x -> 1
        r              *= 1.0 + 0.5 * m;
        return r;
    }
